import { setupSubmission, 
    useFetchSubmissionQuery, 
} from "../store";
import { useDispatch } from "react-redux";
import { useEffect } from "react";

function TryLoadUserSubmission(user)
{
    const fetchSubmission = useFetchSubmissionQuery(user);
    const dispatch = useDispatch();

    console.log(`fetching submission ${user.id}`);
    // Filter and dispatch loaded user questions
    useEffect(() => {
        if(!user || user.id == 0) return;
        if(fetchSubmission.isFetching ||
            fetchSubmission.isLoading ||
            fetchSubmission.error) return;

        dispatch(setupSubmission(fetchSubmission));
        console.log('loaded submission to slice');
        console.log(fetchSubmission);

    }, [user]);

    return [fetchSubmission.isLoading, fetchSubmission.error];
}

export default TryLoadUserSubmission;
